import React from "react";
import "./index.css";

function Linkedin(){
  const link_="data:image/png;base64,";
  return(
    <>
    <div className='cards'>
      <div className='card'>
        <img src={link_} alt="Reload page" className="card_img"/>
        <div className='card_info'>
        <h3 className='card_title'>Linked In</h3>
          <span className='card_category'> This is my linkedin</span>
          <br/>
          <a href="https://www.linkedin.com/in/mani-singh-07313b218/" terget="_blank">
            <button className="but">Visit</button>
          </a>
        </div>
      </div>
      </div> 
    </>
  )
}

export default Linkedin;
